/*

Seeder file creates the nursify database, the units, nurses, and patients tables, and seeds them with 13 units, 200 nurses, and 1000 patients.

*/
-- from the terminal in this directory run:
-- psql < nursify_seeder.sql

DROP DATABASE IF EXISTS nursify;

CREATE DATABASE nursify;

\c nursify

CREATE TABLE units
(
  id SERIAL PRIMARY KEY,
  unit_name TEXT NOT NULL
);

CREATE TABLE nurses
(
  id SERIAL PRIMARY KEY,
  nurse_name TEXT NOT NULL,
  years_exp INT,
  unit INT REFERENCES units(id) ON DELETE CASCADE
);

CREATE TABLE patients
(
  id SERIAL PRIMARY KEY,
  patient_id TEXT UNIQUE,
  last_name TEXT NOT NULL,
  first_name TEXT NOT NULL,
  gender TEXT NOT NULL,
  icd_10 TEXT,
  continent BOOLEAN NULL,
  independently_mobile BOOLEAN NULL,
  num_meds INT,
  high_risk_meds INT,
  num_devices INT,
  num_drips INT,
  new_trach INT,
  tube_feeds INT,
  wound_care INT,
  unit INT REFERENCES units(id) ON DELETE CASCADE
);


